allRecsView.map:
function (doc) {
  if (doc.type == "recs") {
    emit([doc.locale, 0], doc);
    if (doc.events) {
      for (var i in doc.events) {
        emit([doc.locale, 1], {_id: doc.events[i]});
      }
    }
  }
}

itineraryJsonView.map:
function (doc) {
  if (doc.type == "itinerary") {
    emit([doc.itineraryStartDate, doc.version, doc.locale, 0], doc);
    if (doc.events) {
      for (var i in doc.events) {
        emit([doc.itineraryStartDate, doc.version, doc.locale, 1], {_id: doc.events[i]});
      }
    }
  }
}

timeAdjustView.map:
function (doc) {
  if ( doc.type == 'weather' && doc.date.length == 10) {
    emit(doc.date, doc._id, doc);  
  }
}

itineraryView.map:
function (doc) {
  if (doc.type == "itinerary") {
    emit([doc._id, 0], doc);
    if (doc.events) {
      for (var i in doc.events) {
        emit([doc._id, 1], {_id: doc.events[i]});
      }
    }
  }
}

weatherViewFiltered.map:
function (doc) {
  if ( doc.type == 'weather') {
    emit([doc.location.city, doc.location.country, doc.locale], doc);  
  }
}
